PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `Apps` (`TITLE_ID`	TEXT NOT NULL,`NAME`	TEXT,`ALT_NAME`	TEXT,`CONTENT_ID`	TEXT NOT NULL UNIQUE,`PARENT_ID`	TEXT,`CATEGORY`	INTEGER,`PKG_ID`	INTEGER UNIQUE,`ZRIF`	TEXT,`COMMENTS`	TEXT,`FLAGS`	INTEGER NOT NULL DEFAULT 0,FOREIGN KEY(`CATEGORY`) REFERENCES `Categories`(`VALUE`),PRIMARY KEY(`CONTENT_ID`),FOREIGN KEY(`PKG_ID`) REFERENCES `Pkgs`(`ID`));
COMMIT;
PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `Categories` (`NAME`	TEXT NOT NULL UNIQUE,`VALUE`	INTEGER NOT NULL UNIQUE,PRIMARY KEY(`VALUE`));
COMMIT;
PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `Flags` (`NAME`	TEXT NOT NULL UNIQUE,`VALUE`	INTEGER NOT NULL UNIQUE,PRIMARY KEY(`VALUE`));
COMMIT;
PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Pkgs" (
	`ID`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT UNIQUE,
	`URL`	TEXT UNIQUE,
	`SIZE`	INTEGER,
	`SHA1`	TEXT,
	`CATEGORY`	TEXT,
	`APP_VER`	INTEGER,
	`SYS_VER`	INTEGER,
	`C_DATE`	INTEGER,
	`V_DATE`	INTEGER,
	`COMMENTS`	TEXT
);
COMMIT;
PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `Types` (`NAME`	TEXT NOT NULL UNIQUE,`VALUE`	INTEGER NOT NULL UNIQUE,PRIMARY KEY(`VALUE`));
COMMIT;
PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `Updates` (`CONTENT_ID`	TEXT NOT NULL,`VERSION`	INTEGER NOT NULL,`TYPE`	INTEGER NOT NULL,`PKG_ID`	INTEGER NOT NULL UNIQUE,FOREIGN KEY(`TYPE`) REFERENCES `Types`(`VALUE`),FOREIGN KEY(`PKG_ID`) REFERENCES `Pkgs`(`ID`),PRIMARY KEY(`PKG_ID`),FOREIGN KEY(`CONTENT_ID`) REFERENCES `Apps`(`CONTENT_ID`));
COMMIT;
